function reportWindowSize() {
	const bw = document.body;
	if (window.innerWidth < bw.offsetWidth) {
		bw.style.transform = `scale(${window.innerWidth / bw.offsetWidth})`
		bw.style["transform-origin"] = "top left"
		// bw.style.zoom = window.innerWidth / bw.offsetWidth
	} else {
		// bw.style.left = "50%"
		bw.style.transform = `translate(${(window.innerWidth - bw.offsetWidth) / 2}px, 0)`
	}
}

window.onresize = reportWindowSize;
window.onload = reportWindowSize;


var nameArray = ["Accanthis ADF Std No2", "Accanthis ADF Std No2", "Minion Pro", "Sathu"];

var dataArray = ["", "", "", ""];

var fontStretch = ["", "", "", ""];

var fontWeight = ["bold", "normal", "normal", "normal"];

var fontStyleSubArray0 = ["normal"];

var fontStyleSubArray1 = ["normal"];

var fontStyleSubArray2 = ["normal"];

var fontStyleSubArray3 = ["normal"];

var fontStyle = [fontStyleSubArray0, fontStyleSubArray1, fontStyleSubArray2, fontStyleSubArray3];

function buildFontRule(fontFamily, fontData, fontStyle, fontWeight, fontStretch)
{
	if(fontStyle)
	{
	returnValue = "@font-face { font-family:\"" + fontFamily + "\"; font-style:" + fontStyle + ";";
	if(fontWeight)
	{
		returnValue += "font-weight:" + fontWeight + ";";
	}
	if(fontStretch)
	{
		returnValue += "font-stretch:" + fontStretch + ";";
	}

	returnValue += "src:url(\"data:font/opentype;base64," + fontData + "\"); }";
	return returnValue;
	}
	else 
	{
	return "";
	}
}

for (var i in dataArray)
{
for (var j in fontStyle[i])
	{
		document.write("<style>" + buildFontRule(nameArray[i], dataArray[i], fontStyle[i][j], fontWeight[i], fontStretch[i]) + "</style>");
	}
}
